import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import "./Navbar.css"
import nintendo from "../components/images/nintendo.png"

function NavBar() {
    const [name, setName] = useState("");

    function handleSubmit(e) {
        e.preventDefault();
        setName("");
    }

    return (
        <div className="navBar">
            <div >               
                <Link to="/">
                <img clasName="image" src={nintendo} />
                </Link>
            </div>
            <div className="home">
                <Link to="/home">
                    <h3>Videogames!</h3>
                </Link>
            </div>
            <div className="create">
                <Link to="/create">
                <h3>Create</h3>
                </Link>
            </div>
            <div className="searchbar">
                <form onSubmit={(e) => handleSubmit(e)}>
                    <input
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    placeholder="Search"
                    type="search"
                    ></input>
                    <NavLink to={`/results/${name}`}>
                        <button name="name" type="submit">Search</button>
                    </NavLink>
                </form>
            </div>
         
            {/* <div className="about">
                <Link to="/about">
                <h3>About</h3>
                </Link>
            </div> */}
        </div>
    );
}


export default NavBar;
